      <!-- Informations de base -->
      <div style="margin-bottom: 30px;">
        <h2 style="color: #163E67; border-bottom: 2px solid #2BEBCE; padding-bottom: 8px;">Informations du demandeur</h2>
        <div style="display: grid; grid-template-columns: repeat(2, 1fr); gap: 15px; margin-top: 15px;">
          <div><strong>Nom :</strong> ${A.identite.nom||"Non renseign"}</div>
          <div><strong>Prnom :</strong> ${A.identite.prenom||"Non renseign"}</div>
          <div><strong>Date de naissance :</strong> ${A.identite.dateNaissance||"Non renseigne"}</div>
          <div><strong>Nationalit :</strong> ${A.identite.nationalite||"Non renseigne"}</div>
          <div><strong>Situation familiale :</strong> ${A.menage.situation}</div>
          <div><strong>Enfants  charge :</strong> ${A.menage.nbEnfants}</div>
        </div>
      </div>

